    "lpc-pronouns-strings.PronounsStrings.input.suggestion": "Przykłady:",
    "lpc-pronouns-strings.PronounsStrings.learnMore.firstPageFirstParagraphText": "Zaimki to wyrazy, których używamy do zastąpienia czyjegoś imienia w zdaniu, np. „he”, „she” lub „they” w języku angielskim. Pole zaimków jest opcjonalnym miejscem, w którym możesz wyświetlać swoje zaimki innym osobom za pośrednictwem swojego profilu.",
    "lpc-pronouns-strings.PronounsStrings.learnMore.firstPageSecondParagraphText": "Używanie czyichś zaimków poprawnie to prosty sposób na pokazanie, że cenimy sobie inkluzywność i szacunek. Udostępnianie zaimków, gdy się przedstawiasz lub na karcie profilu wpływa na tworzenie bardziej inkluzywnego środowiska i zachęca więcej osób do ich udostępniania.",
    "lpc-pronouns-strings.PronounsStrings.learnMore.firstPageTitle": "Zaimki w Twoim profilu",
    "lpc-pronouns-strings.PronounsStrings.learnMore.learnMoreAltText": "Dowiedz się więcej o obrazie",
    "lpc-pronouns-strings.PronounsStrings.learnMore.secondPageFirstParagraphText": "Ważne jest, aby nie zakładać czyjejś tożsamości płciowej lub zaimków na podstawie pierwszych obserwacji. Kiedy ktoś zwraca się do nas za pomocą niewłaściwego zaimka, możemy poczuć się zlekceważeni i dotknięci. Inwestując w prawidłowe stosowanie zaimków, pokazujemy, że cenimy sobie inkluzywność i uważność. Poświęć czas na nauczenie się czyichś zaimków lub przećwiczenie używania zaimków, których nie znasz.",
    "lpc-pronouns-strings.PronounsStrings.learnMore.secondPageSecondParagraphText": "Pamiętaj, że zaimki są częścią tożsamości danej osoby i tego, jak wyrażamy siebie. Od danej osoby zależy, czy chce udostępniać lub wyświetlać zaimki, czy też nie.",
